import React from 'react'
import { View,Text, Image } from 'react-native';
import { createBottomTabNavigator } from '@react-navigation/bottom-tabs';
import MaterialCommunityIcons from 'react-native-vector-icons/MaterialCommunityIcons';
import { NavigationContainer } from '@react-navigation/native';
import FCHomePage from '../FunctionalComponents/FCHomePage';

const Tab = createBottomTabNavigator();

function MaterialTabPage() {

  function HomeScreen() {
    return (
     <FCHomePage/>
    );
  }

  function GroupsScreen() {
    return (
      <View>
        <Text>TEST</Text>
      </View>
    );
  }

  return (
    <NavigationContainer>
      <Tab.Navigator>
        <Tab.Screen name="Home" component={HomeScreen}
          options={{
            tabBarIcon: () => (
              <MaterialCommunityIcons name="home" size={26} />
            ),
          }} />
        <Tab.Screen name="Groups" component={GroupsScreen}
          options={{
            tabBarIcon: () => (
              <MaterialCommunityIcons name="group" size={26} />
            ),
          }} />
          <Tab.Screen name="Groups1" component={GroupsScreen}
          options={{
            tabBarIcon: () => (
              <MaterialCommunityIcons name="group" size={26} />
            ),
          }} />
           <Tab.Screen name="Groups2" component={GroupsScreen}
          options={{
            tabBarIcon: () => (
              <MaterialCommunityIcons name="group" size={26} />
            ),
          }} />
           <Tab.Screen name="Groups3" component={GroupsScreen}
          options={{
            tabBarIcon: () => (
              <MaterialCommunityIcons name="group" size={26} />
            ),
          }} />
      </Tab.Navigator>
    </NavigationContainer>
  )

}
export default MaterialTabPage;
